                artistBio:
                  'When Asake released <i>Mr. Money With The Vibe</i> in 2022, the relentlessly catchy full-length debut broke streaming records for African albums and trended on digital platforms worldwide. It seemed as if he was anointed by fate to bring Nigerian street pop to the world. The singer and songwriter, born in Lagos in 1995, supercharges the polyrhythms and harmonies of his genre until they only need to be uploaded to go viral. Rather than attempt to polish the rough edges of street pop, he presses the sound forward while reaching deep into its sources, such as fuji music, for inspiration. The 2023 release <i>Work Of Art</i>, for example, sets a new standard for next-generation Afropop. Stacked with uplifting heaters, its progressive production makes a perfect counterpoint to the sticky beats and West African melodies that anchor it. It’s a formula made for taking the music of Lagos global. Maybe it is destiny.',
